(2, '39b70b2291', 'Semua Celana Torio Kids Rp 99.000,-', 'Semua Celana Torio Kids Rp 99.000,-', '', '0f55fae58986ff1b7a78c7c03bacd692.jpg', '', 'Hi! Torio Kids Shopper,\n<br>\n<p>Dapatkan penawaran spesial dari Torio Kids untuk bulan ini: <b>Promo Rp 99.000,- (All Pants).</b>\n<br>Promo ini hanya berlaku dari tanggal 25 - 27 Februari 2015 dan untuk produk bawahan saja (pants).<br>\nKoleksi&nbsp; produk yang di diskon bisa dilihat di <a href="http://www.toriokids.com">www.toriokids.com</a> dan juga Facebook (<a href="http://bit.ly/promo99ribu">http://bit.ly/promo99ribu</a>).<br>\nJangan sampai lewatkan <b>Promo Rp 99.000,- (All Pants) tanggal 25 - 27 Februari 2105</b></p><p></p><br>\n', '', 0, 1, 1424782800, 0, ''),
(3, '1ac0cbf2dd', 'Promo Rp 99.000,-', 'Jangan Lewatkan Promo Rp 99.000,-', '', '2549e253e7868a49aaf4120ae1c477e7.jpg', 'http://www.toriokids.com/product/sale', '<p>Hi! Torio Kids Shopper,</p>\n<p>Dapatkan sekarang juga semua celana produk Torio Kids hanya seharga <b>Rp 99.000,-</b>\n<br>Mulai hari ini sampai jumat (25 -27 Februari 2015) semua produk celana Torio Kids hanya seharga Rp 99.000.-\n<br>Jangan lewatkan kesempatan terbatas ini!.</p>\n\n<p>Belanja sekarang juga di <a href="http://www.toriokids.com">www.toriokids.com</a> </p>\n', '', 0, 1, 1424829600, 1, 'http://www.toriokids.com/product/sale'),
(4, 'b8831c5972', 'Hari Terakhir Promo Rp 99.000,-', 'Hari Terakhir! Semua Celana Hanya Rp 99.000,-', '', 'cf63c4c6da190bb150b9e68166f55b45.jpg', 'http://www.toriokids.com/product/sale', '<p>Hi Torio Kids Shopper,</p>\n\nDapatkan harga khusus dari Torio Kids untuk semua celana. Semua produk celana hanya <b>Rp 99.000,-</b>\n<br>Temukan berbagai jenis celana untuk sang buah hati. Celana untuk anak laki-laki dan perempuan semua tersedia di <a href="http://www.toriokids.com">www.toriokids.com</a>.\n<br>Belanja semakin hemat dan mudah bersama Torio Kids.\n<br>\nBelanja sekarang juga di <a href="http://www.toriokids.com">www.toriokids.com</a><p></p>\n', '', 0, 1, 1425002400, 1, 'http://www.toriokids.com/product/sale'),
(5, '7c3f51e26c', 'Torio Kids Clearance Sale up to 80%!', 'Torio Kids Clearance Sale up to 80%!', '', 'dcb036427424fdf26545294de1209f91.jpg', 'http://www.toriokids.com/', '<p>Hi Torio Kids Shopper,\n\nDapatkan&nbsp; diskon sampai 80% untuk produk Torio Kids hanya pada tanggal 2 April 2015.\n\nTemukan berbagai produk terbaik dari Torio Kids dengan harga yang sangat terjangkau hanya pada tanggal 2 April 2015 saja. Nikmati diskon sampai 80% untuk berbagai produk hanya di www.toriokids.com\n\nCatat tanggalnya 2 April 2015 hanya di <a href="http://www.toriokids.com/">www.toriokids.com</a></p>\n', '', 0, 1, 1427878800, 0, ''),
(6, 'b1a5a14c7e', 'Clearance Sale up to 80% Dimulai Sekarang!', 'Clearance Sale up to 80% Dimulai Sekarang!', '', 'b50c656e392ae390c094db5eeba9aa28.jpg', 'http://www.toriokids.com/', '<p>Selamat pagi Torio Kids Shopper,\n\nDiskon sampai 80% untuk berbagai produk sudah dimulai.\n\nNikmati diskon sampai 80% khusus hari ini saja dari Torio Kids. Jangan lewatkan kesempatan terbatas ini.\nBelanja sekarang juga di <a href="http://www.toriokids.com/">www.toriokids.com</a></p>', '', 0, 1, 1427940000, 1, 'http://www.toriokids.com/product/sale'),
(7, '2bbf5b48ff', 'Diskon 30% Semua Produk Torio Kids', 'Diskon 30% Semua Produk Torio Kids!', '', 'd3694276e06a1f410f060e94c1e9e177.jpg', 'http://www.toriokids.com/product/sale', '<p>Hi bunda,<br><br>Kesempatan bunda untuk mendapatkan diskon 30% untuk semua produk dari Torio Kids tinggal sebentar lagi. Segera kunjungi <a href="http://www.toriokids.com">www.toriokids.com</a> dan temukan berbagai jenis pakaian terbaik untuk anak bunda dengan harga termurah. Promo ini akan berakhir pada 31 Mei 2015.<br><br>Tunggu apalagi dapatkan diskon 30% untuk semua produk hanya di <a href="http://www.toriokids.com">www.toriokids.com</a><br></p>', '', 0, 1, 1432630800, 1, 'http://www.toriokids.com/product/sale'),
(8, '3f9ecd62fe', 'Torio Kids Diskon 30% All Items', 'Hari Ini Torio Kids Diskon 30% All Items Loh!', '', '87b00ee18ac6d2796bbbd3db6865d8e9.jpg', 'http://www.toriokids.com/product/sale', 'Hi Torio Lovers,<br><br>Jakarta Great Sale 2015. Torio Kids diskon 30% all items!<br><br>Mari kita rayakan ulang tahun Jakarta yang ke 488 dengan diskon 30% untuk semua produk.<br>Berbagai produk untuk anak laki-laki dan perempuan dengan berbagai jenis dapat bunda temukan disini.<br><br>Tunggu apalagi segera belanja di <a href="http://www.toriokids.com">www.toriokids.com</a> dan dapatkan diskon 30%.\n', '', 0, 1, 1434765600, 1, 'http://www.toriokids.com/product/sale'),
(11, '3a5622c330', 'Torio Kids Diskon 50% (hanya 3 jam)', 'Torio Kids Diskon 50% (hanya 3 jam)', 'Torio Kids Shopper', 'fde185dc4c839a3b29724943d2e1bd7e.jpg', 'toriokids.com/product/sale', '<p></p><p>Jangan sampai terlewatkan diskon 50% (selected item) dari Torio Kids.</p><p><br></p><p>Nikmati diskon 50% untuk semua\nproduk terbaik dari Torio Kids. Promo ini hanya berlaku 3 jam saja (10.00 -\n13.00 wib) pada tanggal 25 Juni 2015. Produk yang di diskon dapat Anda lihat di\n<a href="http://www.toriokids.com">www.toriokids.com</a>\n\n</p><p><br></p><p>Ingat tanggalnya, 25 Juni 2015 jam 10.00 - 13.00 WIB. Hanya di <a href="http://www.toriokids.com">www.toriokids.com</a></p><p></p>\n', '[{"product_id":"23","price_before":"379000","price_after":"189500"},{"product_id":"33","price_before":"269000","price_after":"134500"},{"product_id":"37","price_before":"309000","price_after":"154500"},{"product_id":"108","price_before":"359000","price_after":"179500"}]', 0, 1, 1435150800, 1, 'toriokids.com/product/sale'),
(12, '68c864a2f4', 'Torio Kids Lebaran Sale 2015', 'Torio Kids Lebaran Sale 2015', 'Torio Lovers', '15b79a334170db96c33e966733f06a56.png', 'toriokids.com/product/sale', '<p><p>Mari sambut Lebaran dengan produk - produk dari Torio Kids\ndi Lebaran Sale!</p>\n\n<p><br></p><p>Jangan lewatkan Lebaran Sale dari Torio Kids mulai tanggal\n10 - 15 Juli 2015. Dapatkan produk terbaik dari Torio Kids dengan diskon 50%\nuntuk semua produk.</p>\n\n<p><br></p><p>Jangan sampai terlewatkan. </p>\n\n</p>', '[{"product_id":"85","price_before":"259000","price_after":"129500"},{"product_id":"80","price_before":"189000","price_after":"94500"},{"product_id":"68","price_before":"259000","price_after":"129500"},{"product_id":"67","price_before":"229000","price_after":"114500"}]', 0, 1, 1436446800, 0, ''),
(13, '2d30a9e970', 'Diskon 50% Semua Produk', 'Diskon 50% Semua Produk', 'Torio Lovers', 'c72c1e8b94239e58f35b647b01be2353.png', 'toriokids.com/product/sale', '<p><p>Nikmati diskon 50% untuk semua produk di Lebaran Sale Torio\nKids!</p>\n\n<p><br></p><p>Jangan lewatkan Lebaran Sale dari Torio Kids mulai tanggal\n10 - 15 Juli 2015. Dapatkan produk terbaik dari Torio Kids dengan diskon 50%\nuntuk semua produk.</p>\n\n<p><br></p><p>Tunggu apalagi belanja sekarang juga.</p><br></p>', '[{"product_id":"57","price_before":"269000","price_after":"134500"},{"product_id":"31","price_before":"219000","price_after":"109500"},{"product_id":"79","price_before":"269000","price_after":"134500"},{"product_id":"75","price_before":"259000","price_after":"129500"}]', 0, 1, 1436493600, 1, 'toriokids.com/product/sale'),
(15, '903611675a', 'Hemat Sampai 70%!', 'Hemat Sampai 70%!', 'Torio Lovers!', 'a56d2a5dbbdb2e2c67820fe73f06e551.jpg', 'http://www.toriokids.com/product/sale', '<p></p><p>Dapatkan diskon 30% untuk semua produk di <a href="http://www.torikids.com">www.toriokids.com</a> selama bulan November - Desember 2015. Promo ini hanya berlaku untuk pembelanjaan melalui website saja.</p><p>Khusus\n untuk minggu ini semua celana/bottoms untuk anak laki-laki dan \nperempuan ada diskon kejutan sebesar 70%. Ingat hanya untuk minggu ini \nsaja! Tunggu apalagi belanja sekarang juga!</p><br><p></p>\n', '[{"product_id":"42","price_before":"219000","price_after":"65700"},{"product_id":"71","price_before":"299000","price_after":"89700"},{"product_id":"50","price_before":"249000","price_after":"74700"},{"product_id":"91","price_before":"249000","price_after":"74700"}]', 0, 1, 1446264000, 1, 'http://www.toriokids.com/product/sale'),
(16, 'b9b9c226a1', 'Diskon Celana 70%', 'Diskon Celana 70%', 'Torio Lovers', '0d8c66d30e4994e78dfdc9b0f57fd845.jpg', 'http://www.toriokids.com/product/view_product_per_sub_category/bottoms_10/2', '<p><b>Penawaran Terbatas!</b><br>Dapatkan <b>Diskon 70%</b> untuk semua celana laki-laki dan perempuan di <a href="http://www.toriokids.com">www.toriokids.com</a> hanya di minggu ini saja. Jangan sampai kehabisan tunggu apalagi belanja sekarang juga! <br></p><p>Promo hanya berlaku di website saja. Cek barangnya sekarang!<br></p>\n', '[{"product_id":"91","price_before":"249000","price_after":"74700"},{"product_id":"52","price_before":"20900","price_after":"62700"},{"product_id":"32","price_before":"179000","price_after":"53700"},{"product_id":"86","price_before":"229000","price_after":"68700"}]', 0, 1, 1446778800, 1, 'http://www.toriokids.com/product/sale'),
(17, '51791eb56c', 'Last Day! Diskon up to 70%', 'Last Day! Diskon up to 70%', 'Torio Lovers', '4f73823b54680824ba8138dd47df7352.jpg', 'http://www.toriokids.com/product/sale', '<p><b>Hari Terakhir!</b><br>Buruan belanja sekarang dan dapatkan <b>Diskon 70%</b> untuk semua celana laki-laki dan perempuan khusus hari ini saja!</p><p>Hanya hari ini kesempatan terakhir untuk mendapatkan diskonnya sekarang juga hanya di www.toriokids.com <br></p>\n', '[{"product_id":"22","price_before":"219000","price_after":"65700"},{"product_id":"44","price_before":"219000","price_after":"65700"},{"product_id":"35","price_before":"209000","price_after":"62700"},{"product_id":"32","price_before":"179000","price_after":"53700"}]', 0, 1, 1446951600, 1, 'http://www.toriokids.com/product/sale'),
(18, '991ec36885', 'Diskon All T-Shirt 70%', 'Diskon All T-Shirt 70%', 'Torio Lovers', '784a5b7283dae57cc13bf717dbb5e946.jpg', 'http://www.toriokids.com/product/view_product_per_sub_category/tees___tops_9/2', '<p>Dapatkan kesempatan <b>Diskon 70% </b>untuk semua T-shirt dari <a href="http://www.toriokids.com.">www.toriokids.com.</a> <br></p><p>Buruan belanja sekarang diskon hanya sampai minggu ini saja. <br></p><p>Yuk belanja sekarang juga dan nikmati <b>Diskon 70%</b>!<br></p>', '[{"product_id":"97","price_before":"259000","price_after":"77700"},{"product_id":"82","price_before":"219000","price_after":"65700"},{"product_id":"68","price_before":"259000","price_after":"77700"},{"product_id":"63","price_before":"189000","price_after":"56700"}]', 0, 1, 1447158600, 1, 'http://www.toriokids.com/product/sale'),
(19, '6d9f8fd33e', 'Last Day! Diskon 70% All T-shirt', 'Last Day! Diskon 70% All T-shirt', 'Torio Lovers', 'f6cee9d90384a7ca557b211b2b5df901.jpg', 'www.toriokids.com/product/sale', '<p>Hari Terakhir <b>Diskon 70% </b>!</p><p>Dapatkan kesempatan terakhir <b>Diskon 70%</b> untuk semua t-shirt laki-laki dan perempuan hanya di <a href="http://www.toriokids.com">www.toriokids.com</a></p><p>Jangan sampai kehabisan buruan belanja sekarang!</p><p><br></p>\n', '[{"product_id":"38","price_before":"149000","price_after":"44700"},{"product_id":"40","price_before":"189000","price_after":"56700"},{"product_id":"97","price_before":"349000","price_after":"104700"},{"product_id":"67","price_before":"229000","price_after":"68700"}]', 0, 1, 1447556400, 1, 'www.toriokids.com/product/sale'),
(20, 'c5f8447e1e', 'Christmas Collection Discount 30% off!', 'Christmas Collection Discount 30% off!', 'Torio Lovers', 'cee1660a51af58a10db62dc9ff8d5524.jpg', 'www.toriokids.com/product/sale', '<p><p>Mau baju baru untuk anak anda menjelang Natal dan Tahun Baru?</p><p>Yuk buruan belanja di <a href="http://www.toriokids.com">www.toriokids.com</a> dan dapatkan <b>diskon 30%</b> untuk koleksi edisi Natal.</p>Buruan belanja sekarang juga untuk mendapatkan <b>diskon 30%</b> sebelum kehabisan!<br></p>', '[{"product_id":"151","price_before":"249000","price_after":"174300"},{"product_id":"150","price_before":"469000","price_after":"328300"},{"product_id":"149","price_before":"329000","price_after":"230300"},{"product_id":"148","price_before":"339000","price_after":"237300"}]', 0, 1, 1447902000, 1, 'www.toriokids.com/product/sale'),
(21, '6e888793fa', 'Diskon Up to 50% All Item!', 'Diskon Up to 50% All Item!', 'Torio Lovers', '7aa484d5334ca9a77b269924b005820a.jpg', 'www.toriokids.com/product/view_product_per_sub_category/dresses_8/2/12', '<p>Jangan lewatkan <b>Diskon up to 50%</b> dari <a href="http://www.toriokids.com">www.toriokids.com</a> untuk semua produk.</p><p>Yuk belanja sekarang untuk mendapatkan dress dengan <b>Diskon 50%</b> sekarang juga.</p><p>Jangan sampai ketinggan dan kehabisan hanya minggu ini saja.<br></p>', '[{"product_id":"53","price_before":"279000","price_after":"139500"},{"product_id":"36","price_before":"259000","price_after":"129500"},{"product_id":"41","price_before":"189000","price_after":"94500"},{"product_id":"8","price_before":"209000","price_after":"104500"}]', 0, 1, 1448332200, 1, 'www.toriokids.com/product/view_product_per_sub_category/dresses_8/2/12'),
(22, '965a78e49c', 'Last Day! Diskon 50% Dresses', 'Last Day! Diskon 50% Dresses', 'Torio Lovers!', '26ef67378175cc9bc54fdeae97598e2d.jpg', 'www.toriokids.com/product/view_product_per_sub_category/dresses_8/2/12', '<p>Dapatkan kesempatan terakhir <b>Diskon 50%</b> untuk semua dress hanya di <a href="http://www.toriokids.com.">www.toriokids.com.</a> <br></p><p>Kesempatan terbatas hanya sampai minggu ini saja.</p><p>Yuk belanja sekarang hanya di Torio Kids!<br></p>', '[{"product_id":"53","price_before":"279000","price_after":"139500"},{"product_id":"9","price_before":"229000","price_after":"114500"},{"product_id":"79","price_before":"269000","price_after":"134500"},{"product_id":"41","price_before":"189000","price_after":"94500"}]', 0, 1, 1448769600, 1, 'www.toriokids.com/product/sale'),
(23, '681af62265', 'Diskon 70% All Item Season 1!', 'Diskon 70% All Item Season 1!', 'Torio Lovers!', '97e45d73f3245b31f51e670fb7fae634.jpg', 'http://www.toriokids.com/product/sale/72', '<p>Dapatkan <b>Diskon 70%</b> untuk semua produk season 1 hanya di <a href="http://www.toriokids.com">www.toriokids.com</a></p><p>Yuk segera dapatkan produknya sebelum kehabisan.</p><p>Hanya untuk minggu ini saja!<br></p>\n', '[{"product_id":"8","price_before":"209000","price_after":"62700"},{"product_id":"21","price_before":"179000","price_after":"53700"},{"product_id":"27","price_before":"169000","price_after":"50700"},{"product_id":"24","price_before":"249000","price_after":"74700"}]', 0, 1, 1449039600, 1, 'http://www.toriokids.com/product/sale/72'),
(24, '4390738325', 'Last Day! Diskon 70% All Season 1', 'Last Day! Diskon 70% All Season 1', 'Torio Lovers!', '3439ba9c4b6e90337a75d78afc6d2353.jpg', 'www.toriokids.com/product/sale/72', '<p>Jangan sampai ketinggalan kesempatan terakhir <b>Diskon 70%</b> untuk semua koleksi season 1 hanya di <a href="http://www.toriokids.com">www.toriokids.com</a></p><p><b>Diskon 70%</b> All season 1 hanya di Torio Kids belanja sekarang dan dapatkan produknya dengan berbagai macam pilihan untuk anak anda.</p><p><br></p>\n', '[{"product_id":"31","price_before":"219000","price_after":"65700"},{"product_id":"27","price_before":"169000","price_after":"50700"},{"product_id":"24","price_before":"249000","price_after":"74700"},{"product_id":"18","price_before":"139000","price_after":"41700"}]', 0, 1, 1449975600, 1, 'www.toriokids.com/product/sale/72'),
(25, 'ecbcd8da97', 'Diskon Up to 50% All Item!', 'Diskon Up to 50% All Item!', 'Torio Lovers!', '1b9cdd695c388576f1f658e56d313c25.jpg', 'www.toriokids.com/product/sale/72', '<p><b>Diskon Akhir Tahun dari Torio Kids!</b><br></p><p><br></p><p>Jangan lewatkan <b>Diskon 50% </b>untuk semua produk dari <a href="http://www.toriokids.com.">www.toriokids.com.</a></p><p>Semua barang diskon 50% termasuk baju dan aksesoris.</p><p>Diskon hanya sampai akhir tahun.<br></p><p><br></p><p>Buruan belanja sekarang jangan sampai kehabisan diskonnya.<br></p>\n', '[{"product_id":"144","price_before":"309000","price_after":"154500"},{"product_id":"126","price_before":"239000","price_after":"119500"},{"product_id":"94","price_before":"189000","price_after":"94500"},{"product_id":"66","price_before":"229000","price_after":"114500"}]', 1, 1, 0, 1, 'www.toriokids.com/product/sale/');
