INSERT INTO `content_page_tb` (`id`, `name`, `alias`, `content`, `precedence`, `active`) VALUES
(1, 'The Torio Story', 'the-torio-story-1', '<p>\n</p><p>Torio was born in 1992 and began its journey as a retail\nbrand specializing in high end children wear within the Indonesian market. Our international\ncollections, inspired by the European’s fashionable design spread far and wide,\nand by 1996 have been featured in more than 7 independent Torio show rooms and in\nmultiple department stores in Jakarta.</p><p><span style="color: #95b3d7;"><br></span></p><span style="color: #95b3d7;">\n\n</span><p><span style="color: #8CC63F;">In 2000, Torio began to spread its wings further and climbed\nto the peak its height by going international presenting itself within the\nEuropean market and the Middle Eastern territories. </span><br></p><p><br></p>\n\n<p>To focus better on the ever increasing demand in the global\nmarket and with Torio’s new partnership with Walt Disney Company, Torio in 2007\nbriefly ends its expansion in Indonesia and swift its full aim to focus on the\ninternational market.</p><p><br></p><p>\n\n<span style="color: #0070BC;">In 2013, growing more inspired and matures by\nour experience in the international market, Torio was reborn and embraces the\nE-commerce in which finally launched our first click & shop, <a href="http://www.toriokids.com">www.toriokids.com</a></span></p><p><a href="http://www.toriokids.com"><br></a></p><p><a href="http://www.toriokids.com"><br></a>\n</p><h2>Kisah Torio</h2><br>\n<p><i>Torio lahir pada tahun\n1992 dan memulai perjalanan pertamanya sebagai merk retail yang berfokuskan\ndengan baju anak-anak di pangsa pasar Indonesia. Koleksi internasional kami\nyang berinspirasikan dari design Eropa bergaya\nmodern berkembang secara pesat, dan pada tahun 1996 sudah dapat ditemukan di 7\ncabang toko Torio dan berbagai department store di Jakarta. <br></i></p><p><i><br></i></p>\n\n<p><span style="color: #8CC63F;"><i>Pada tahun 2000, Torio\nmulai lebih mengembangkan sayapnya dan memasuki puncak kejayaan di pangsa\ninternasional dengan memulai masuk di pasar Eropa dan daerah Timur Tengah.</i></span></p><p><i><br></i></p>\n\n<p><i>Untuk dapat\nmemfocuskan lebih baik terhadap permintaan pasar internasional dan juga dengan\ndimulainya kerjasanya Torio dan Walt Disney Company, pada tahun 2007 Torio\nmenghentikan untuk sementara operasi ekspansi di Indonesia dan mengarahkan\nsecara penuh seluruh focusnya di pasar dunia. <br></i></p><p><i><br></i></p>\n\n<p><span style="color: #0070BC;"><i>Pada tahun 2013, setelah\nberkembang dengan inspirasi-inspirasi baru dari pengalaman kami di pasar\ninternasional, Torio terlahir kembali dan memulai dengan E-commerce dimana kami\nhadir dengan toko online pertama kami, </i><a href="http://www.toriokids.com"><i>www.toriokids.com</i></a></span><i><br></i></p>\n<p></p>\n', 1, 1),
(2, 'Contact Us', 'contact-us-2', '<p><b>Operating Hours</b><br></p><p>Monday – Friday 8:30am – 17:00pm <br></p>\n<p><br></p><p>\n<b>Email</b></p>\n<p><a href="mailto:cs@toriokids.com">cs@toriokids.com</a></p><p><a href="mailto:cs@toriokids.com"><br></a></p>\n<p><b>Fax</b></p>\n<p>+62-21-5802781</p><p><br></p>\n<p><b>Mail</b></p>\n<p>Green Garden Blok Y3 No.23<br></p><p>Jakarta Barat, Indonesia</p><br>\n<p><b>US Representative</b></p>\n<p>Scarlet Florensia<br>\n+1 (909) 906 6655<br>\n<a href="scarlet@toriokids.com">scarlet@toriokids.com</a></p>\n', 2, 1),
(3, 'Our Values', 'our-values-3', '<p><span style="color:#0070BC;">Torio is a family owned and as such, we value the term\nfamily as the basis of our inspiration.</span> Within our collections you will\ndiscover practical luxury and modern designs that aims to inspire both parents\nand their children to embrace togetherness.</p><p><br></p><p><br></p><p></p><h2>Inspirasi Kami<br></h2><p>\n</p><i><span style="color:#0070BC; font-style:italic;"><br></span></i><p><i><span style="color:#0070BC; font-style:italic;">Torio\nadalah sebuah perusahaan keluarga, dan karena itu kami sangat menghargai kata\nkeluarga sebagai dasar dari semua inspirasi kami.</span></i> Didalam koleksi kami anda\nakan menemukan kemewahan praktis dan design yang modern yang ditujukan untuk\nmenginspirasi baik orang tua dan anak-anak mereka agar dapat selalu menghargai\nkebersamaan<strong style="color:#0070BC;">.</strong></p><p></p><strong style="color:#0070BC;"><strong style="color:#0070BC;">\n</strong>\n</strong>\n', 3, 1),
(4, 'Privacy Policy', 'privacy-policy-4', 'Selamat Datang &amp; Terima Kasih atas kunjungan anda di\nsitus kami <a href="http://www.toriokids.com">TorioKids.com</a>.\n<p><br></p><p>Kami sangat menghargai &amp; berkomitmen untuk memastikan bahwa\nprivasi Anda dilindungi. Kebijakan Privasi ini dapat berubah dari waktu ke\nwaktu tanpa pemberitahuan terlebih dahulu, oleh karena itu kami menyarankan\nsetiap pengunjung yang akan menggunakan situs ini untuk memeriksa halaman ini\nsecara berkala agar Anda dapat mengetahui perubahan-perubahan tersebut.</p>\n<p>Dengan mengakses dan menggunakan layanan pada situs kami,\nAnda dianggap telah menerima semua kegiatan yang dijelaskan dalam kebijakan\nprivasi ini. </p>\n<p>Kebijakan privasi ini akan memberitahukan anda tentang\nperihal:</p>\n<ul><li>Jenis informasi yang dikumpulkan oleh Torio Kids</li><li>Bagaimana informasi tersebut akan digunakan</li><li>Komitmen kami untuk melindungi keamanan dari informasi\n     tersebut</li><li>Bagaimana anda dapat menghubungi Torio Kids</li></ul>\n<p><br></p><p><b><br></b></p><h3><b>Jenis Informasi Yang Kami Minta</b></h3>\n<p><br></p><p>Kami menerima dan menyimpan informasi yang anda berikan\nsecara sukarela disaat anda akan membeli dari Torio Kids, registrasi di situs\nTorioKids.com, bergabung dengan mailing list kami, atau di waktu-waktu lain\ndimana anda memberikan informasi tentang diri anda.</p>\n<p>Identitas diri yang Kami dapat secara sukarela dari Anda\nmelalui situs TorioKids.com adalah: </p>\n<ul><li>Nama lengkap</li><li>Alamat surat elektronik (email)</li><li>Nomor Telepon</li><li>Alamat lengkap</li><li>Alamat pengiriman</li><li>Informasi kartu kredit berupa:</li></ul>\n\n<p><span>-<span>&nbsp;\n</span></span>Nomor kartu kredit</p>\n\n<p><span>-<span>&nbsp;\n</span></span>Masa berlaku kredit </p>\n\n<ul><li>Nama dan umur anak anda</li><li>Informasi lain yang anda berikan secara sukarela</li></ul>\n<p>Kami mengasumsikan bahwa semua informasi dan\nperubahan-perubahan yang Anda berikan di atas sekarang, atau di masa yang akan\ndatang adalah akurat dan benar. Apabila informasi dan perubahan-perubahan yang\nAnda berikan tersebut ternyata terbukti tidak benar, maka dengan ini Kami\nmenyatakan tidak bertanggung jawab atas segala akibat yang dapat terjadi\nsehubungan dengan pemberian informasi dan perubahan-perubahan yang tidak benar\ntersebut.</p>\n<p><br></p><p><b><br></b></p><h3><b>Penggunaan Pelacakan (Cookies) &amp;\nTeknologi Lainnya</b></h3>\n<p><br></p><p>Kami ingin anda mengetahui bahwa kami menggunakan cookie\n&amp; teknologi pelacakan untuk membantu melayani dan mengenal anda secara\nlebih baik disaat anda mengunjungi TorioKids.com. Teknologi pelacakan dan <i>cookie</i>\nbermanfaat untuk mengumpulkan informasi seperti jenis browser dan system\noperasional, mendata jumlah pengunjung situs dan memahami cara pengunjung\nmenggunakan situs. Informasi pribadi tidak dapat dikumpulkan melalui <i>cookie</i>\ndan teknologi pelacak lainnya. Namun, jika Anda sebelumnya memberikan informasi\nidentitas pribadi, <i>cookie</i> dapat membantu untuk berhubung terhadap\ninformasi tersebut.</p>\n<p><br></p><p><b><br></b></p><h3><b>Penggunaan Informasi</b></h3>\n<p><br></p><p>Kami memerlukan informasi sebagaimana tersebut di atas\nuntuk:</p>\n\n\n\n<ul><li>Memberikan ketepatan waktu dan konfirmasi yang akurat\n     dari semua permintaan</li><li>Mengatur pembayaran untuk semua pemesanan </li><li>Mengirimkan pesanan yang telah anda lakukan</li><li>Mendaftarkan anda dengan TorioKids.com</li><li>Menjawab dan melayani semua pertanyaan ataupun\n     permintaan yang anda ajukan</li><li>Memberikan informasi &amp; promosi secara berkala bila\n     terdapat suatu penawaran dan/atau promosi atas produk-produk baru,\n     penawaran khusus atau informasi lain yang berguna bagi anda di\n     TorioKids.com</li><li>Mengumpulkan data transaksi antara Anda dengan\n     Toriokids.com dan ataupun mitra usaha Kami, termasuk informasi mengenai\n     penggunaan anda terhadap produk-produk dan layanan yang Kami sediakan.</li><li>Catatan internal/administrasi Kami.</li></ul>\n<p><br></p><p><b><br></b></p><h3><b>Komitmen Untuk Keamanan Data Pribadi\n</b></h3>\n<p><br></p><p>Kami berkomitmen untuk memastikan bahwa informasi yang Anda\nberikan kepada Kami dalam keadaan aman. Untuk mencegah akses tidak sah, Kami\nmelakukan tindakan standard pengamanan fisik, elektronik, dan prosedur\nmanajerial yang diperlukan untuk melindungi informasi Anda yang Kami kumpulkan\nsecara online. </p>\n<p>Semua data pribadi yang anda berikan atapun diakses melalui\nTorioKids.com diamankan melalui server pribadi yang juga kami lindungi dengan\nstandard komersil untuk mencegah akses yang tidak di inginkan. Tetapi harap\ndapat disadari, bahkan dengan semua langkah-langkah keamanan yang telah kami\nlakukan, perlindungan keamanan tetap tidak dapat dijamin secara sempurna.&nbsp;\n</p>\n\n\n\n<p><br></p><p><b><br></b></p><h3><b>Koneksi Ke Website Lain</b></h3>\n\n\n\n<p><br></p><p>Untuk keperluan referensi dan kenyamanan Anda, Website Kami\nmungkin menyediakan link ke situs-situs lain. Situs-situs diluar TorioKids.com\nmempunyai kebijakan pengamanan privasi yang berbeda dan oleh karena itu Kami\ntidak bertanggung jawab untuk melindungi privasi dan informasi apapun yang Anda\nberikan ketika mengunjungi situs-situs tersebut. </p>\n<p>Entitas apapun yang Anda pilih sebagai kontak atau\nberinteraksi baik yang terdaftar dalam direktori ataupun di tempat lain selain\ndari Situs TorioKids.com, adalah sepenuhnya tanggung jawab layanan tersebut\npada Anda, dan Anda setuju bahwa Situs TorioKids.com tidak dapat dikenakan\ntindakan apapun untuk kerusakan atau biaya yang keluar atas interaksi yang\nterjadi antara Anda dengan layanan yang bersangkutan.</p>\n<p><br></p><p><b><br></b></p><h3><b>Kontak Informasi Untuk Perihal\nPrivasi Anda</b></h3>\n<p><br></p><p>Apabila Anda memiliki pertanyaan, keluhan, atau komentar\ntentang kebijakan privasi kami, Anda dapat menghubungi kami dengan menggunakan\ninformasi di bawah ini:</p>\n<p><b>PT Torio Multi Nasional</b></p>\n<p><b>Head Office: </b></p>\n\n<p>Green Garden Blok Y3 No. 23</p>\n\n<p>Jakarta Barat</p>\n<p>PH: +62-21-5828436 (attn: Ibu Dwi)</p>\n\n<p>FAX: +62-21-5802781</p>\n\n<p>EMAIL: <a href="mailto:cs@toriokids.com">cs@toriokids.com</a></p>\n<p>Syarat-syarat dan ketentuan dalam Kebijakan Privasi ini\ntunduk kepada hukum di wilayah Negara Kesatuan Republik Indonesia. </p>\n\n<p><b><br>\nKami tidak akan menjual, mendistribusikan, atau menyewakan informasi pribadi\nAnda kepada pihak ketiga, kecuali jika Kami diharuskan oleh undang-undang yang\nberlaku di Indonesia untuk melakukannya.</b></p>\n', 4, 1),
(5, 'Terms & Conditions', 'terms-n-conditions-5', '<p>TorioKids.com adalah jasa online\nyang dimiliki dan dioperasikan oleh P.T. Torio Multi Nasional. Segala aktifitas\ndan aturan yang bersangkutan langsung dengan website ini akan sepenuhnya diatur\noleh syarat dan ketentuan di bawah ini.</p>\n<p>Dalam waktu yang tidak ditentukan\nsyarat dan ketentuan akan berubah. Penggunaan anda atas website ini harus\nmengikuti setiap perubahan yang merupakan bagian dari perjanjian dan terikat\noleh persyaratan sesuai dengan perubahan yang ada tanpa terkecuali.<br><br></p>\n\n<p><strong></strong></p>\n\n<p><b><strong><u>Barang dan Jasa</u></strong></b></p>\n<p>P.T. Torio Multi Nasional merupakan\nperusahaan ritel yang memperjual belikan barang fashion dan retail.</p><p><strong><br></strong></p>\n<p><b><u>Kebijakan Pemesanan</u></b></p>\n<p>·&nbsp;Pelanggan terlebih dahulu\nmemilih produk yang ingin dengan meng-klik “Beli.”</p>\n\n<p>·&nbsp;Setelah pesanan masuk ke\nkeranjang belanja, pelanggan dapat memilih untuk menambah pesanan belanja atau\nCheckout untuk proses selanjutnya.</p>\n\n<p>·&nbsp;Dalam proses checkout\npelanggan diminta untuk login terlebih dahulu atau membuat registrasi baru.</p>\n\n<p>·&nbsp;Kemudian pelanggan harus\nmengikuti 3 langkah checkout seperti berikut:</p>\n\n<p>-<span>&nbsp;\n</span>Alamat KTP dan Alamat Billing Statement : Pelanggan\ndiminta untuk mengupdate alamat pengiriman lain jika ada.</p>\n\n<p>-<span>&nbsp;\n</span>Payment Method : Pelanggan diminta untuk memilih jenis\npembayaran.</p>\n\n<p>-<span>&nbsp;\n</span>Confirm Order : Pelanggan diminta untuk menyetujui\nketentuan yang berlaku di TORIO KIDS (setelah proses ini pelanggan akan\nmendapatkan email tentang informasi pemesanan).</p><p><br></p>\n<p><b><u>Kebijakan Pembayaran</u></b></p>\n<p>Kami memberikan beberapa metode\npembayaran:</p>\n<p>·&nbsp;Pembayaran dengan Credit\nCards : Visa and Mastercard.</p>\n\n<p>·&nbsp;Pembayaran dengan Internet\nBanking.</p>\n\n<p>·&nbsp;Pembayaran dengan Virtual\nAccount.</p>\n\n<p>·&nbsp;Pembayaran dengan transfer\nke rekening kami.</p><p><br></p>\n<p>Khusus pembayaran dengan kartu\nkredit, pelanggan harus meng-klik submit untuk proses pembayaran online dan\nmemasukan data pemegang kartu kredit.</p>\n<p><br></p><p>Kami tidak bertanggung jawab atas\npenyalahgunaan kartu kredit atau alat pembayaran apapun yang merupakan hak\nmilik anda dan di luar jangkauan pengawasan kami.</p>\n<p><br></p><p>Pembayaran melalui transfer bank\nharus melakukan konfirmasi pembayaran dengan memilih salah satu metode:</p>\n<p>-<span>&nbsp;\n</span>Mengisi form konfirmasi yang ada di menu “Payment\nConfirmation”</p>\n\n<p>-<span>&nbsp;\n</span>Kirim Email ke <a href="mailto:order@TorioKids.com">order@TorioKids.com</a>\natau cs@TorioKids.com dengan di dalam isi </p>\n\n<p>mencantumkan Nama, Nomor telpon, Nomor order, Jumlah\ntransfer, bank transfer.</p>\n<p><br></p><p>Setiap member otomatis akan\nterdaftar dengan <a href="http://www.stamps.co.id">www.stamps.co.id</a> disaat\nmelakukan transaksi dan pembayaran di <a href="http://www.toriokids.com.">www.toriokids.com.</a></p>\n<p><br></p><p>Registrasi dengan Stamps adalah gratis\ndan tanpa biaya, dimana member akan mendapatkan poin untuk setiap pembelanjaan\ndan dapat digunakan untuk ditukarkan dengan reward-reward yang menarik.</p>\n<p><br></p><p>Mata uang yang digunakan dan\nberlaku sah dalam pembelian pada website ini adalah dalam Indonesia Rupiah\n(IDR)<b>.(Semua transaksi akan diproses dalam mata uang Rupiah).</b></p><p><b><br></b></p>\n<p><b>Semua transaksi akan diproses\ndalam kurun waktu 1x 24 jam.</b></p><p><b><br></b></p>\n<p><b>Customer kemudian diwajibkan\nuntuk menyelesaikan pembayaran dan apabila transaksi pembayaran telah berhasil\ndilakukan, kami akan mengirimkan tanda terima pembayaran melalui surat\nelektronik (e-mail) kepada alamat e-mail yang tercantum dalam data pribadi\npembeli dalam waktu max 1 (satu) hari setelah proses pembayaran selesai\ndilakukan.</b></p><p><b><br></b></p>\n<p><strong><u>Bukti Transaksi\n(Invoice)</u></strong></p>\n<p>·&nbsp;Invoice merupakan bukti\ntransaksi yang sah sebagai bukti pemesanan dan pembelian dan sebagai acuan\nreferensi pembelian Anda.</p>\n<p id="pengembalian">·&nbsp;<b>Anda dihimbau untuk\nmenyimpan invoice dari setiap pembelian anda yang mungkin akan berguna untuk\npelayanan setelah pembelian.</b>(Simpan bukti pembayaran bila sewaktu2\ndiperlukan).</p><p><br></p>\n<p><strong><u>Kebijakan pengembalian\nbarang, pengembalian dana (refund) dan pembatalan (cancellation)</u></strong></p>\n<p>Kami tidak melayani pengembalian\nbarang kecuali apabila ada kesalahan dari pihak kami dan di luar dari yang\nsudah ditetapkan dalan syarat dan ketentuan pada halaman ini. Pengembalian\nbarang yang terjadi di luar dari kesepakatan penyelesain masalah pembelian yang\ntelah disetujui kedua belah pihak bukan merupakan tanggung jawab dan bagian\ndari pelayanan kami. Kami tidak bertanggung jawab atas barang yang anda\nkembalikan karena secara sah barang tersebut sudah menjadi hak milik dan\ntanggung jawab anda.</p>\n<p>·&nbsp;Retur berlaku apabila barang\nyang di terima dalam keadaan rusak/cacat/aksesoris tidak lengkap.</p>\n\n<p>·&nbsp;Refund berlaku apabila\nbarang yang telah di pesan dan dibayar tidak ada stock dan akan kami kembalikan\ndlam bentuk Kredit Balance.</p>\n\n<p><strong>·&nbsp;Pembatalan Pesanan\n(cancelation)dibatalkan secara sepihak apabila:</strong></p>\n\n<p>-<span>&nbsp;\n</span><strong>Anda belum melakukan pembayaran</strong>dalam\nwaktu 3x24 jam setelah order atau atas permintaan pelanggan.</p>\n\n<p>-<span>&nbsp;\n</span><strong>Kami belum menerima pembayaran anda.</strong></p>\n\n<p>-<span>&nbsp;\n</span><strong>Tanggal berlaku pada invoice untuk order\ntersebut sudah kadaluarsa.</strong></p><p><strong><br></strong></p>\n<p><b><u>&nbsp;Kebijakan Pengiriman</u></b></p>\n<p>·&nbsp;Pengiriman produk akan\ndilakukan setelah TORIO KIDS melakukan verifikasi via email atau yahoo\nmessenger atau melalui form konfirmasi atas pembayaran yang dilakukan\npelanggan. Pelanggan dapat mengetahui status pemesanan melalui resi pengiriman\nyang dikirim lewat email.</p>\n<p>·&nbsp;Pengiriman pada hari yang\nsama, apabila pemesanan produk dan konfirmasi pembayaran dilakukan sebelum pukul\n12.00 siang pada jam operasional.</p>\n<p>·&nbsp;Barang yang dikirim sudah\ndiasuransikan.</p><p><br></p>\n<p><b><u>Kebijakan Privasi</u></b></p>\n<p>Kami di TORIO KIDS menjaga privasi\nAnda dengan sangat serius. Kami percaya bahwa privasi elektronik sangat penting\nbagi keberhasilan berkelanjutan dari Internet.<br>\nKami percaya bahwa informasi ini hanya dan harus digunakan untuk membantu kami\nmenyediakan layanan yang lebih baik. Itulah sebabnya kami telah menempatkan\nkebijakan untuk melindungi informasi pribadi Anda.</p>\n\n<p><br></p><p><br>\n<b><u>Ringkasan Kebijakan kami</u></b></p>\n\n<p><br>\nSecara umum, ketika Anda mengunjungi situs web kami dan mengakses informasi\nAnda akan tetap sebagai anonim. Sebelum kami meminta Anda untuk mengisi\ninformasi, kami akan menjelaskan bagaimana informasi ini akan digunakan. Kami\ntidak akan memberikan informasi pribadi Anda kepada perusahaan lain atau\nindividu tanpa se-izin Anda.</p>\n\n<p><br>\nBeberapa bagian dari website kami memerlukan pendaftaran untuk mengaksesnya,\nwalaupun biasanya semua yang diminta adalah berupaalamat e-mail dan beberapa\ninformasi dasar tentang Anda.</p>\n\n<p><br>\nAda bagian di mana kami akan meminta informasi tambahan. Kami melakukan ini\nuntuk dapat lebih memahami kebutuhan Anda, dan memberikan Anda palayanan yang\nkami percaya mungkin berharga bagi Anda. Beberapa contoh informasi website kami\nbutuhkan seperti nama, email, alamat rumah, dan info pribadi. Kami memberikan\nAnda kesempatan untuk memilih untuk tidak menerima materi informasi dari kami.</p><p><br></p>\n<p><b><u>Melindungi privasi Anda</u></b></p>\n\n<p><br>\nKami akan mengambil langkah yang tepat untuk melindungi privasi Anda. Setiap\nkali Anda memberikan informasi yang sensitif (misalnya, nomor kartu kredit\nuntuk melakukan pembelian), kami akan mengambil langkah-langkah yang wajar\nuntuk melindungi, seperti enkripsi nomor kartu Anda. Kami juga akan mengambil\nlangkah-langkah keamanan yang wajar untuk melindungi informasi pribadi Anda\ndalam penyimpanan.<b>Nomor kartu kredit hanya digunakan untuk proses pembayaran\ndan bukan disimpan untuk tujuan pemasaran.<br>\nKami tidak akan memberikan informasi pribadi Anda kepada perusahaan lain atau\nindividu tanpa izin Anda</b>.<b><u>"Proses Proses order anda kami pastikan\naman dengan protokol&nbsp; Secure Sockets Layer (SSL) dimana SSL menyediakan\nsetiap pelanggan keamanan penuh dan kebebasan untuk belanja online tanpa rasa\nkhawatir mengenai kemungkinan pencurian informasi&nbsp; kartu kredit"&nbsp;</u></b></p>\n\n<p><br>\n<br>\n<b><u>Penggunaan Cookie</u></b></p>\n\n<p><br>\nSitus ini menggunakan "cookies" untuk mengidentifikasi sesi pengguna\npada Website dan dengan demikian menawarkan kontinuitas sebagai anggota\nbergerak di sekitar lokasi. Cookie hanya digunakan pada Situs untuk menyimpan\ndata yang non-kritis. Cookies adalah potongan informasi yang situs mentransfer\nke hard drive komputer Anda untuk tujuan menyimpan catatan.</p>\n\n<p><br>\nCookie memungkinkan situs web untuk menjaga informasi pengguna di seluruh\nkoneksi. Cookie berupa string kecil berupa karakter yang digunakan oleh banyak\nsitus untuk mengirimkan data ke komputer Anda, dan dalam keadaan tertentu,\nmengembalikan informasi ke situs web. Cookie hanya berisi informasi bahwa\nanggota relawan, dan mereka tidak memiliki kemampuan infiltrasi hard drive\npengguna dan mencuri informasi pribadi. Fungsi sederhana cookie adalah membantu\npengguna menavigasi situs web dengan sebagai obstruksi sesedikit mungkin.</p>\n\n<p><b><u><br>\nKeamanan</u></b></p>\n\n<p><br>\nSitus ini memiliki langkah-langkah keamanan untuk melindungi kehilangan,\npenyalahgunaan dan perubahan informasi di dalam kendali kita. Langkah-langkah\nini meliputi metode perlindungan data dasar dan kompleks, dalam penyimpanan\noffline tertentu informasi dan securitizing server database kami.</p>\n\n<p><br>\nSitus ini memberikan pilihan bagi para untuk menghapus informasi mereka dari database\nkami untuk tidak menerima informasi kedepannya atau untuk tidak lagi menerima\nlayanan kami.</p><p><br></p>\n<p><strong><u>Masukan, Saran, dan\nPesan</u></strong></p>\n<p>Perkembangan dan peningkatan\npelayanan kami tidak terlepas dari adanya masukan dari anda. Jika anda ingin\nmemberi masukan, saran, atau pesan, Anda dapat menghubungi customer care kami\ndi <a href="mailto:cs@TorioKids.com">cs@TorioKids.com</a> atau di halaman\nfacebook kami <a href="http://www.facebook.com/toriokids">www.facebook.com/toriokids</a>\natau dengan mudah mengisi form pesan kami di halaman <u>customer service</u>.</p><p><br></p>\n<p><strong><u>Jam Operasional</u></strong></p>\n\n<p></p>\n\n<p>Kami akan memproses formulir\nkonfirmasi pembayaran pada hari dan waktu operasional kantor TORIO KIDS yaitu\nSenin-Jumat jam 08.30-17.30.</p>\n', 5, 1);
