(7, 'Like Torio Kids Fan Page & Get 20% OFF!!', 'like-torio-kids-fan-page-n-get-20-off-7', '<p><b>1. Klik tombol "Like Our FB & Get 20% OFF!"</b><br></p><p></p><p><img style="" src="http://www.toriokids.com/userdata/content/d0bf9c3a59e41bb0e5a22d26e2738376.jpg"></p><p><br></p><br><p></p><p><b>2. Apabila anda belum sign in facebook, maka akan tampil jendela baru untuk menginput alamat email dan kata sandi anda.</b></p><p><b>Klik "Masuk" untuk melanjutkan ke langkah selanjutnya.</b><br></p><p></p><p><img style="" src="http://www.toriokids.com/userdata/content/d623a4a3bee8f958513b3c7666a2fec1.jpg"></p><p><br></p><br><p></p><p><b>3. Klik "Okay" pada jendela berikutnya.</b><br></p><p></p><p><img style="" src="http://www.toriokids.com/userdata/content/459af92fb533af75d6a614647ec921c7.jpg"></p><br><br><p></p><p><b>4. Klik "Okay" pada jendela berikutnya.</b><br></p><p></p><p><img style="" src="http://www.toriokids.com/userdata/content/fa1eb1a466f2995105cbae97779c0ea0.jpg"></p><br><br><p></p><p><b>5. Klik tombol "Like"</b><br></p><p></p><p><img style="" src="http://www.toriokids.com/userdata/content/12accd0e9b66176d2245abaf31eaf842.jpg"></p><br><br><p></p><p><b>6. Apabila anda sudah tersambung dengan akun facebook anda, maka tombol anda akan berubah menjadi "Get 20% OFF Now!"</b></p><p><b>Klik tombol "Get 20% OFF Now!" untuk mengaplikasikan diskon spesial anda.</b><br></p><p></p><p><img style="" src="http://www.toriokids.com/userdata/content/34accbd263c876be265caeecfc46a2f7.jpg"></p><br><br><p></p><p><b>7. Diskon spesial anda sudah diaplikasikan di keranjang belanja anda! Selamat berbelanja :)</b><br></p><p></p><p><img style="" src="http://www.toriokids.com/userdata/content/b9d765772ec416c8ca38b0ac688ee351.jpg"></p><br><br><br><i><b>Syarat dan Ketentuan:</b><br></i><ol><li><i>Diskon berlaku untuk minimum pembelanjaan IDR 200.000,-</i></li><li><i>Diskon tidak dapat digabungkan dengan promo ataupun diskon lainnya.</i></li><li><i>Promo berlaku sampai dengan 30 April 2014.</i></li></ol><p></p>\n', 7, 1),
