(10, 'Flash Sale Terms & Conditions', 'flash-sale-terms-n-conditions-10', '<p><img style="" src="http://www.toriokids.com/userdata/redactor/9a22321b545de9946e69f7c2e6172a67.jpg"></p><b><p></p><br>Syarat &amp; ketentuan Diskon Abis! Torio:</b>\n<br>\n<ol>\n<li>Promo Diskon Abis Torio 50% berlangsung pada tanggal 5 februari 2015 pukul 11.00 – 14.00 WIB.</li>\n<li>Diskon 50% berlaku untuk semua produk Torio Kids.</li>\n<li>Pembelian hanya dapat dilakukan di website <a href="http://www.toriokids.com">www.toriokids.com</a></li>\n<li>Persediaan barang terbatas.</li>\n<li>Metode pembayaran dapat dilakukan dengan menggunakan kartu kredit dan bank transfer.</li>\n<li>Pembelian barang dianggap sah setelah pembayaran selesai dilakukan dan diterima oleh toriokids.</li>\n<li>Barang yang dibeli disaat promo flash sale berlangsung tidak dapat ditukar ataupun dikembalikan</li>\n<li>Pihak Torio Kids berhak membatalkan pesanan apabila tidak memenuhi syarat dan ketentuan yang berlaku.</li>\n<li>Dengan mengikuti promo ini, maka pelanggan dianggap mengerti dan menyetujui semua syarat dan ketentuan yang berlaku.</li>\n<li>Syarat dan ketentuan dapat berubah sewaktu-waktu tanpa pemberitahuan terlebih dahulu.</li>\n</ol>\n', 10, 1),
