(12, 'Terms & Conditions Lebaran Sale 2015', 'terms-n-conditions-lebaran-sale-2015-12', '<p></p><p><a href="http://www.toriokids.com/product/sale"><img style="" src="http://www.toriokids.com/userdata/redactor/331eb11ca98ff7617fd2c351b3630750.png"></a></p><br><p></p>\n\nTerms &amp; Conditions / Syarat &amp; Ketentuan:\n<br>\n<ol> \n<li>Diskon berlangsung dari tanggal 10 Juli - 15 Juli 2015</li>\n<li>Pengiriman akan dilakukan pada tanggal 23 Juli 2015 (10 Juli – 22 Juli 2015 Torio Kids libur)</li>\n<li>Promo tidak dapat digabung dengan promo lainnya.</li>\n<li>Persediaan barang terbatas.</li>\n<li>Pembelian barang dianggap sah setelah pembayaran berhasil dilakukan.</li>\n<li>Promo hanya berlaku bagi pelanggan www.toriokids.com</li>\n<li>Torio Kids berhak membatalkan pesanan apabila tidak memenuhi syarat  dan ketentuan yang berlaku.</li>\n<li>Dengan mengikuti syarat dan ketentuan ini, maka pelanggan dianggap mengerti dan menyetujui semua aturan yang berlaku.</li>\n<li>Syarat dan ketentuan dapat berubah sewaktu-waktu tanpa pemberitahuan terlebih dahulu.</li>\n</ol>\n', 12, 1);
