INSERT INTO `faq_tb` (`id`, `faq_category_id`, `question`, `answer`, `precedence`, `active`) VALUES
(1, 2, 'How to shop in Toriokids.com?', '', 1, 0),
(2, 1, 'Is there a minimum order quantity in Toriokids.com?', '', 1, 0),
(3, 3, 'How to shop in Toriokids.com?', '', 1, 0),
(4, 3, 'Is there a minimum order quantity in Toriokids.com?', '', 2, 0),
(5, 3, 'Do you provide wholesale purchase?', '', 3, 0),
(6, 3, 'Can I cancel my order in Toriokids.com?', '', 4, 0),
(7, 3, 'What is the return policy of Toriokids.com?', '', 5, 0),
(8, 3, 'Can I order during the weekend or public holiday?', '', 6, 0),
(9, 4, 'How can I make my payment for Toriokids.com?', '', 1, 0),
(10, 4, 'How secure is the payment process in Toriokids.com?', '', 2, 0),
(11, 4, 'How can I pay with Bank transfer?', '', 3, 0),
(12, 4, 'What is the duration of time if I make my purchase via Bank transfer?', '', 4, 0),
(13, 4, 'How can I pay with Credit Card?', '', 5, 0),
(14, 4, 'How can I check the status of my payment?', '', 6, 0),
(15, 5, 'Is the price listed in Toriokids.com already includes shipment fee?', '', 1, 0),
(16, 5, 'What is the cost of the shipment of each item?', '', 2, 0),
(17, 5, 'How long does it take to deliver my orders?', '', 3, 0),
(18, 5, 'What can I do if I receive the wrong orders/damaged orders?', '', 4, 0),
(19, 5, 'Do you ship during the weekend or public holiday?', '', 5, 0),
(20, 3, 'Bagaimana cara berbelanja di TorioKids.com?', 'Kenyamanan dan kemudahan berbelanja Anda adalah priority kami di Torio Kids\n\nAnda dapat memulai pencarian Anda dari pembagian category yang telah disediakan baik melalui ‘search’ box yang tertera di sebelah kanan dari website kami. Setelah memilih product berikut quantity yang diminati, Anda dapat melanjutkan dengan memilih ADD TO SHOPPING BAG. \n\nSetelah selesai, ikuti langkah-langkah pemesanan & pembayaran berikutnya dan barang Anda akan segera siap untuk kami kirimkan \n', 7, 1),
(21, 3, 'Apakah ada minimum order untuk pembelian di Torio Kids?', 'Torio Kids tidak memberikan minimum order untuk semua pemesanan produk yang ada di website kami. \nSalah satu langkah kami untuk memudahkan pemesanan Anda tanpa harus bergerak jauh dari kenyamanan di rumah Anda\n', 8, 1),
(22, 3, 'Dapatkah saya membatalkan atau merubah pesanan saya?', 'Pemesanan dapat Anda rubah atau Anda batalkan apabila Anda belum melakukan transaksi pembayaran ke rekening kami. Namun apabila Anda telah melakukan pembayaran dengan pemesanan tersebut, maka kami tidak dapat melakukan proses pembatalan karena pesanan Anda secara otomatis langsung diproses oleh tim pengantaran kami', 9, 1),
(23, 3, 'Apakah produk yang sudah dibeli dapat dikembalikan?', 'Produk yang sudah dibayar dapat dikembalikan dengan maksimum 2 hari kerja dari tanggal pengiriman dan hanya apabila ada kesalahan dari pihak kami (salah barang atau barang cacat produksi) setelah produk Anda terima. Apabila kesalahan pemesanan disebabkan karena kelalaian Anda dalam memesan, kami mohon maaf karena kami tidak dapat melakukan penukaran untuk barang tersebut.  ', 10, 1),
(24, 3, 'Apakah Torio Kids melayani pembelian secara whole sale?', 'Apabila Anda tertarik untuk melakukan pembelian dengan quantity lebih dari 5 lusin per jenis baju, Anda dapat menghubungi kami di cs@toriokids.com untuk informasi lebih lanjut', 11, 1),
(25, 3, ' Apakah pesanan saya akan diproses apabila saya memesan di hari Sabtu, Minggu dan hari libur Nasional?', 'Pemesanan Anda akan diproses pada hari kerja (Senin - Jumat pukul 09.00 - 17.00 wib). Apabila Anda melakukan pemesanan dan pembayaran di hari Sabtu, Minggu dan hari libur Nasional, maka akan diproses di hari kerja setelahnya. ', 12, 1),
(26, 4, 'Bagaimana cara melakukan pembayaran di TorioKids.com?', 'Torio Kids memberikan opsi pembayaran yang dapat Anda melakukan melalui transfer Bank berikut pembayaran dengan menggunakan Kartu Kredit', 7, 1),
(27, 4, 'Apakah proses pembayaran di TorioKids.com aman?', 'Torio Kids sangat mengutamakan keamanan Anda, dan kami berkomitment untuk memastikan bahwa semua data personal yang Anda berikan tidak akan pernah akan digunakan untuk hal yang merugikan. ', 8, 1),
(28, 4, 'Bagaimana cara melakukan pembayaran melalui transfer Bank?', 'Anda dapat melakukan pembayaran melalui transfer Bank baik via atm ataupun online dimana batas waktu adalah 2 x 24 jam setelah pemesanan dilakukan. Jika lewat dari batas waktu yang diberikan maka pemesanan dianggap batal dan Anda harus melakukan pemesanan ulang. Apabila Anda melakukan transfer bukan dari Bank BCA, pastikan Anda melakukan pembayaran secepatnya, karena transfer dari Bank yang berbeda  membutuhkan waktu yang lebih lama sampai uang dapat kami terima', 9, 1),
(29, 4, 'Bagaimana cara melakukan pembayaran dengan Kartu Kredit?', 'Anda dapat melakukan pembayaran dengan menggunakan Kartu Kredit dengan memasukan nomor yang tertera pada kartu Anda berikut nomor CVC yang tertera dibelakang kartu Anda. \nBagi penyedia jasa perBankan yang telah terdaftar dalam jaringan 3D Secure, dimana kode otorisasi akan dikirimkan melalui SMS setiap kali Pembeli melakukan pembayaran menggunakan kartu kredit. Pastikan Anda telah memasukan semua data dengan benar. Kemudian klik "pay". Apabila transaksi berhasil, Anda akan otomatis masuk ke thank you page. Setelah transaksi pembayaran berhasil, status order Anda akan otomatis berubah menjadi "processing". Anda dapat mengecek status order ini di "My Account"\n', 10, 1),
(30, 5, 'Apakah harga yang tertera di TorioKids.com sudah termasuk biaya pengiriman?', 'Harga yang tercantum di setiap produk belum termasuk biaya pengiriman', 6, 1),
(31, 5, 'Berapakah biaya pengiriman untuk pesanan saya?', '', 7, 0),
(32, 4, 'Bagaimana cara mengcheck status pembayaran saya?', '', 11, 0),
(33, 5, 'Berapa lama waktu yang dibutuhkan hingga produk dapat kami terima?', 'Estimasi waktu pengiriman produk untuk wilayah Jakarta adalah 1-3 hari kerja. Jangka waktu pengiriman produk untuk wilayah lainnya ditentukan oleh lokasi Anda. Waktu pengiriman dihitung semenjak Anda mendapatkan email konfirmasi pengiriman dari kami. Pengiriman akan dilakukan setelah pengecekan dan konfirmasi pembayaran selesai. ', 8, 1),
(34, 5, 'Apa yang dapat saya lakukan apabila product yang saya terima salah ataupun tidak sesuai dengan pemesanan saya?', '', 9, 0),
(35, 5, 'Apakah ada pengiriman di hari Sabtu, Minggu dan hari Libur Nasional?', 'Tidak ada pengiriman pada hari Sabtu, Minggu, dan hari libur nasional. Barang Anda akan segera dikirimkan mengikuti jadwal hari kerja. ', 10, 1),
(36, 6, 'Apa yang dapat saya lakukan apabila pertanyaan saya tidak tertera pada halaman ini?', '', 1, 0);
