(3, 0, 0, 9, '50-494', '["2"]', '["3","4"]', 'Little Shoes Dungaree w/ Inner Top', 'little-shoes-dungaree-w-inner-top_3', 114500, 50.00, 0.10, 'Pakaian lucu untuk anak perempuan. Set ini berupa t-shirt putih beserta jumper pink yang menarik dalam pilihan ukuran 0m, 3m, 6m, dan 12m. Semua pakaian Torio adalah bebas dari bahan formalin dan azo dye untuk kenyamanan dan kesehatan yang terbaik bagi putra putri anda', 0, 0, 1, 229000, 0, 1),
(4, 0, 0, 9, '70-167', '["2"]', '["4"]', 'Little Shoes Long Top w/ Short Fine Twill pants', 'little-shoes-long-top-w-short-fine-twill-pants_4', 109500, 50.00, 0.10, 'Pakaian lucu untuk anak perempuan. Set ini berupa short dress putih beserta celana pendek kuning yang menarik dalam pilihan ukuran 0m, 3m, 6m, dan 12m. Semua pakaian Torio adalah bebas dari bahan formalin dan azo dye untuk kenyamanan dan mutu kesehatan yang terbaik bagi putra putri anda', 0, 0, 1, 219000, 0, 1),
(5, 0, 0, 9, '90-025', '["2"]', '["8"]', 'Little Shoes Mini Dress w/Headband Accessories ', 'little-shoes-mini-dress-w-headband-accessories_5', 109500, 50.00, 0.10, 'Pakaian lucu untuk anak perempuan. Set ini berupa fashionable long dress dengan bando kuning yang menarik dalam pilihan ukuran 0m, 3m, 6m, dan 12m. Semua pakaian Torio adalah bebas dari bahan formalin dan azo dye untuk kenyamanan dan kesehatan yang terbaik bagi putra putri anda', 0, 0, 1, 219000, 0, 1),
(6, 0, 0, 9, '70-151', '["2"]', '["4"]', 'Little Shoes Long Top Set w/Short Chambray pants', 'little-shoes-long-top-set-w-short-chambray-pants_6', 104500, 50.00, 0.10, 'Pakaian lucu untuk anak perempuan. Set ini berupa long top lengan pendek berwarna pink dengan celana pendek chambray yang menarik dalam pilihan ukuran 0m, 3m, 6m, dan 12m. Semua pakaian Torio adalah bebas dari bahan formalin dan azo dye untuk kenyamanan dan kesehatan yang terbaik bagi putra putri anda', 0, 0, 1, 209000, 0, 1),
